import './Input.css';
import Media from 'react-media';
import { useForm } from 'react-hook-form';

// Input Field Component 
export default function ReturnInput() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <SreenLarge />}
     {matches.large && <SreenLarge />}
    </>
   )}
  </Media>
 );
};

export const SreenLarge = () => {

 const { register, handleSubmit } = useForm({});
 const onSubmit = (data) => {

  console.log(data);
 };

 return (
  <div className='wrp-input-signin-register'>
   <form onSubmit={handleSubmit(onSubmit)}>

    <input type='text' placeholder='Nom' name='nom' {...register('nom', { required: true })} />
    <input type='text' placeholder='Prenom' />
    <input type='text' placeholder='Ville' />
    <input type='text' placeholder='Addresse' />
    <input type='date' placeholder='Date de naissance' />

    <button>Enregistre</button>

   </form>
  </div>
 )
}
export const ScreenSmall = () => (
 <div className='wrp-input-signin-register-sm'>
  <form>

   <input type='text' placeholder='Nom' />
   <input type='text' placeholder='Prenom' />
   <input type='text' placeholder='Ville' />
   <input type='text' placeholder='Addresse' />
   <input type='date' placeholder='Date de naissance' />

   <button className='btn-sm'>Enregistre</button>
  </form>
 </div>
);
